INPUT_UILabel_animateIn_tween_code:
//Keys: alpha, text, shader, string

${text}.alpha = ${alpha};

${shader}.set('uTransition', 0);
${shader}.tween('uTransition', ${text}.length(), 50 * ${text}.length(), 'linear').onUpdate(function(progress) {
    var value = Math.floor(${text}.length() * progress);

    if (${text}.value !== value) {
        var now = new Date().getTime();
        
        ${text}.value = value;
        ${text}.loaded().then( function() {
            if ( now !== new Date().getTime() ) return;
            ${text}.setText(StringUtils.shuffle(${string}, value));
        })
    }
}).onComplete( function() {
    ${text}.loaded().then( function() {
        ${text}.setText(${string});
    });
});

